var Beautifier={beautify:function(a){return a.replace(/([A-z$_][\w$]*)\["([A-z$_][\w$]*)"\]/g,function(a,b,d){return b+"."+d})},split:function(a){a=a.split(/\s*\,\s*/);for(var c=[],b=0,d=a.length;b<d;b++){var e=a[b];'"'===e[0]&&'"'===e[e.length-1]&&c.push(e.substring(1,e.length-1))}return c},unescape:function(a){a=a.replace(/\\([0-7])/gi,function(a,b){return String.fromCharCode(Number(parseInt(b,8).toString))});a=a.replace(/\\x([a-f\d]{2})/gi,function(a,b){return String.fromCharCode(parseInt(b,16))});
a=a.replace(/\\u([a-f\d]{4})/gi,function(a,b){return String.fromCharCode(parseInt(b,16))});return'"'+a+'"'},unpack:function(a){if(/^var\s_0x[a-f\d]+\s*\=\s*\[/.test(a)){var c=/var\s(_0x[a-f\d]+)\s*\=\s*\[(.*?)\][;,]?/.exec(a);if(c){var b=c[1],c=Beautifier.split(c[2]);a=a.replace(/var (_0x[a-f\d]+) ?\= ?\[(.*?)\][;,]?/,"");for(var d=0,e=c.length;d<e;d++)a=a.replace(new RegExp(b+"\\["+d+"\\]","g"),Beautifier.unescape(c[d]));a=Beautifier.beautify(a)}}return a}},textarea=document.getElementById("textarea");
